def add_watermark(image_path, base64_str):
    if not base64_str or len(base64_str) < 50 or "PLACEHOLDER" in base64_str:
        return
    try:
        clean_str = "".join(base64_str.split())
        rem = len(clean_str) % 4
        if rem > 0: clean_str += "=" * (4 - rem)
        logo_data = base64.b64decode(clean_str)
        logo = Image.open(BytesIO(logo_data)).convert("RGBA")
        base_img = Image.open(image_path).convert("RGBA")
        bw, bh = base_img.size
        logo_w = int(bw * 0.06)
        w_percent = (logo_w / float(logo.size[0]))
        logo_h = int((float(logo.size[1]) * float(w_percent)))
        logo = logo.resize((logo_w, logo_h), Image.Resampling.LANCZOS)
        position = (bw - logo_w - 30, 30) 
        transparent = Image.new('RGBA', base_img.size, (0,0,0,0))
        transparent.paste(base_img, (0,0))
        transparent.paste(logo, position, mask=logo)
        transparent.convert("RGB").save(image_path)
    except: pass

def get_red_folder_intel():
    tz_est = pytz.timezone('US/Eastern')
    today_reds = []
    try:
        url = "https://www.quantcrawler.com/redfolder"
        resp = anti_bot_requests.get(url, impersonate="chrome120", timeout=15)
        soup = BeautifulSoup(resp.text, 'html.parser')
        for row in soup.find_all(['tr', 'div']):
            text = row.get_text().lower()
            if "usd" in text and ("high" in text or "red" in text):
                today_reds.append(f"üö© **{row.get_text().strip()[:60]}**")
    except: pass
    if not today_reds: return "‚úÖ No High Impact USD News Today.", 0x2ecc71
    return "\n".join(list(set(today_reds))), 0xe74c3c

def get_finnhub_briefing(api_key):
    if not api_key: return "News feed offline."
    url = f"https://finnhub.io/api/v1/news?category=general&token={api_key}"
    try:
        resp = discord_requests.get(url, timeout=10)
        data = resp.json()
        found = []
        assets = {"Gold": ["gold", "xau"], "Nasdaq": ["nasdaq", "tech", "nq"]}
        for item in data[:40]:
            h, l = item['headline'], item['url']
            for name, keys in assets.items():
                if any(k in h.lower() for k in keys):
                    found.append(f"‚Ä¢ **{name}**: [{h[:65]}...]({l})")
                    break
            if len(found) >= 2: break
        return "\n".join(found) if found else "No sector headlines."
    except: return "Briefing unavailable."

def get_precision_data(ticker):
    # Fetch 5m data for macro levels
    df_5m = yf.download(ticker, period="5d", interval="5m", multi_level_index=False, progress=False)
    if df_5m.empty: return None, None
    df_5m.index = df_5m.index.tz_convert('US/Eastern')
    
    session_start = datetime.combine(df_5m.index[-1].date(), dtime(8, 30)).replace(tzinfo=pytz.timezone('US/Eastern'))
    window_5m = df_5m[df_5m.index >= session_start]
    if window_5m.empty: window_5m = df_5m.tail(50)
    
    sess_o = window_5m.iloc[0]['Open']
    aH, aL = (window_5m['High'] - sess_o).tolist(), (sess_o - window_5m['Low']).tolist()
    
    def p_rank(arr, p):
        s = sorted(arr)
        return s[max(0, math.ceil((p/100) * len(s)) - 1)]

    raw_lvls = {
        "P50 H": sess_o + p_rank(aH, 50), "P50 L": sess_o - p_rank(aL, 50),
        "P75 H": sess_o + p_rank(aH, 75), "P75 L": sess_o - p_rank(aL, 75),
        "P90 H": sess_o + p_rank(aH, 90), "P90 L": sess_o - p_rank(aL, 90)
    }

    # Filter Duplicates and Tight Levels (Clearance logic)
    sorted_items = sorted(raw_lvls.items(), key=lambda x: x[1])
    clean_lvls = {}
    last_p = -float('inf')
    
    # Clearance threshold: 1.5 ticks for Gold (0.15) or 0.02% of price for visual room
    clearance = sess_o * 0.0002 

    for label, price in sorted_items:
        if abs(price - last_p) > clearance:
            clean_lvls[label] = price
            last_p = price
    
    # Fetch 1m data for the chart
    df_1m = yf.download(ticker, period="5d", interval="1m", multi_level_index=False, progress=False)
    if df_1m.empty: return None, None
    df_1m.index = df_1m.index.tz_convert('US/Eastern')
    
    return df_1m.tail(150), clean_lvls

